  `clock_server_address` varchar(50) DEFAULT NULL COMMENT '时钟服务器地址',
  `server_sync_freq` int(11) DEFAULT NULL COMMENT '管理端同步频率(分钟)',
  `bubble_tag` int(11) DEFAULT NULL COMMENT '弹出气泡标识',
