-- ----------------------------
-- Table structure for cfg_process
-- ----------------------------
DROP TABLE IF EXISTS `cfg_process`;
CREATE TABLE `cfg_process` (
  `id` bigint(20) NOT NULL,
  `strategy_templet_id` bigint(20) DEFAULT NULL COMMENT '策略模板编号',
  `is_service` varchar(255) DEFAULT NULL COMMENT '是否为服务（0-普通进程，1-服务，2-预留）',
  `is_black` varchar(255) DEFAULT NULL COMMENT '是否启用黑名单（0 未启用,1启用）',
  `black_short_name` varchar(255) DEFAULT NULL COMMENT '黑名单简称',
  `is_white` varchar(255) DEFAULT NULL COMMENT '是否黑名单（0-白，1-黑）',
  `white_short_name` varchar(255) DEFAULT NULL COMMENT '白名单进程简称',
  `net_status` varchar(255) DEFAULT NULL COMMENT '是否启用网络连接',
  `net_address` text COMMENT '允许ip地址，以;分割',
  `alarm_level` int(11) DEFAULT NULL COMMENT '报警级别（1一般 2异常 3违规）',
  `send_time` datetime DEFAULT NULL COMMENT '策略发送时间',
  `is_used` varchar(255) DEFAULT NULL COMMENT '是否启用',
  `enable_flag` varchar(255) DEFAULT NULL COMMENT '是否可用，逻辑删除（Y-可用，N-不可用）',
  `os_id` bigint(20) DEFAULT NULL COMMENT '主机id',
  `process_name` varchar(400) DEFAULT NULL COMMENT '进程名',
  `process_info` varchar(400) DEFAULT NULL COMMENT '进程其他信息',
  `start_time` datetime DEFAULT NULL COMMENT '监控开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '监控结束时间',
  `notes` varchar(255) DEFAULT NULL COMMENT '说明',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(255) DEFAULT NULL COMMENT '最后更新者',
  `update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `upload_flag` varchar(255) DEFAULT NULL COMMENT '是否已上报',
  `is_send` varchar(255) DEFAULT NULL COMMENT '终端是否接受此策略（1-已接受，0-未接受）',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `idx_templet_unique` (`strategy_templet_id`,`is_service`,`is_used`,`enable_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of cfg_process
-- ----------------------------

-- ----------------------------
-- Table structure for cli_log
-- ----------------------------
DROP TABLE IF EXISTS `cli_log`;
CREATE TABLE `cli_log` (
  `logid` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '日志id',
  `os_ip` varchar(255) DEFAULT NULL COMMENT '客户端ip地址',
  `os_id` varchar(255) DEFAULT NULL COMMENT '预留与系统主机ID对应',
  `info` varchar(4000) DEFAULT NULL COMMENT '事件客体',
  `details` varchar(4000) DEFAULT NULL COMMENT '事件内容（详细信息）',
  `result` varchar(255) DEFAULT NULL COMMENT '事件结果（1-成功，0-失败）',
  `entry_time` datetime DEFAULT NULL COMMENT '事件发生时间',
  `level` varchar(255) DEFAULT NULL COMMENT '风险级别（0-紧急，1-警报，2-关键，3-错误，4-警告，5-通知，6-信息，7-调试）',
  `type` varchar(255) DEFAULT NULL COMMENT '事件种类（m-管理操作，a-用户操作，s-其他）',
  `be_type` varchar(255) DEFAULT NULL COMMENT '行为类别（1-违规行为，2-异常行为，3-一般行为）',
  `log_type` varchar(255) DEFAULT NULL COMMENT '日志分类（1.本地文件审计，2.U 盘文件审计，3.开机关机审计，4.进程监控审计，5.打印监控审计，6.主机信息审计，7.系统日志审计，8.账户监控审计，9.共享监控审计， 10.异常监控审计，11.主机配置审计， 12.移动介质审计，13.端口监控审计，14.服务监控审计，15.连接监控审计，16.网络流量检测，17.磁盘空间检测，18.文件控制，19.光盘刻录审计）',
  `notes` varchar(255) DEFAULT NULL COMMENT '说明（保留字段）',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建者（保留字段）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间（保留字段）',
  `update_by` varchar(255) DEFAULT NULL COMMENT '最后更新者（保留字段）',
  `update_time` datetime DEFAULT NULL COMMENT '最后更新时间（保留字段）',
  PRIMARY KEY (`logid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4169 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of cli_log
-- ----------------------------

