INSERT INTO `sys_log` VALUES ('3179', '1', 'admin', 'error', null, 'http://localhost/os/osInfo/list', 'org.springframework.jdbc.BadSqlGrammarException: \r\n### Error querying database.  Cause: com.mysql.jdbc.exceptions.jdbc4.MySQLSyntaxErrorException: Unknown column \'t.osNames\' in \'group statement\'\r\n### The error may exist in file [D:\\new-eclipse\\neon-eclipse-workplace\\anhuay\\target\\classes\\mybatis\\strategy\\OsStrategyMapper.xml]\r\n### The error may involve defaultParameterMap\r\n### The error occurred while setting parameters\r\n### SQL: SELECT GROUP_CONCAT(distinct t.templet_name ORDER BY t.templet_id DESC SEPARATOR \';\') FROM ahy_os_strategy t where   t.os_names  LIKE CONCAT(\'%\',?,\'%\') GROUP BY t.osNames\r\n### Cause: com.mysql.jdbc.exceptions.jdbc4.MySQLSyntaxErrorException: Unknown column \'t.osNames\' in \'group statement\'\n; bad SQL grammar []; nested exception is com.mysql.jdbc.exceptions.jdbc4.MySQLSyntaxErrorException: Unknown column \'t.osNames\' in \'group statement\'', null, '2018-08-25 18:03:39');
